import React from 'react';

function SignUpPage ( ) {
    return (
        <div>
            <h1>펫토리</h1>
            <p>회원가입 페이지임</p>
            <button type="button">취소</button>
            <button type="button">확인</button>
        </div>
    );
}

export default SignUpPage;
